import React from "react";

const Nav = () => {
  const menuItems = [
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
    {
      title: "Home",
      link: "#",
      className: "",
    },
  ];
  return (
    <div>
      <nav className="NavbarItems">
        <h1 className="NavbarLogo">Nadvbar</h1>
        <div className="MenuIcon"></div>
        <ul>
          {menuItems.map((item, index) => {
            return <li className={item.className}>{item.title}</li>;
          })}
        </ul>
      </nav>
    </div>
  );
};

export default Nav;
